import Movie_board from './Movie_board'
import { BrowserRouter, Routes, Route } from "react-router-dom";
import '../components/App';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={
        <div className="App">
          <Movie_board/>
        </div>}>
          <Route index element={<Home />} />
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
